import React from "react";
import "./experience.scss";
import ProcessArray from "../../json/process.json";

export default function About() {
  return (
    <div className="Experience Section__spacing">
      <div className="Title">
        <h4>Experience</h4>
      </div>

      <div className="Experience__process">
        {ProcessArray &&
          ProcessArray.map((Process, index) => (
            <div className="Experience__process_item" key={Process.id}>
              <span className="Experience__year">{Process.years}</span>
              <span className="Experience__company">{Process.company}</span>
              <span className="Experience__position">{Process.position}</span>
              <ul className="Experience__detail">
                {Process.details &&
                  Process.details.map((Details, index) => (
                    <li key={"child--" + index}>{Details}</li>
                  ))}
              </ul>
            </div>
          ))}
      </div>
    </div>
  );
}
